import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';

class HeaderAdmin extends Component {
    render() {
        return (
            <tr>
                <td scope="row" className='col-lg-1'>{this.props.stt + 1}</td>
                <td scope="row" className='col-lg-2'>{this.props.product.productName}</td>
                <td scope="row" className='col-lg-1'>{this.props.product.productPrice}</td>
                <td scope="row" className='col-lg-2'><img src={"images/" + this.props.product.productImage}/></td>
                <td scope="row" className='col-lg-1'>{this.props.product.productUnit}</td>
                <td scope="row" className='col-lg-2'>{this.props.product.productDescriptions}</td>
                <td scope="row" className='col-lg-1'><NavLink to='' className="fa fa-edit"></NavLink>|<NavLink to='' className="fa fa-delete"></NavLink></td>
                
            </tr>
        )
    }
}

export default HeaderAdmin;
